// ALMWrapper provides high-level operations for ALM devices combining SNMP and REST
// This version extends your original file with additional controls surfaced in the UI
// (Admin State, Monitoring Priority, extended thresholds, and convenience wrappers
// for fingerprint variants like PON / DPA / PES). Unknown OIDs are marked TODO for
// confirmation against your MIB/PDF; existing behavior is preserved.

type ALMWrapper struct {
    restClient *Client
    snmpClient *snmp.Client
    logger     *zerolog.Logger
    deviceID   string
    ipAddress  string
}

// NewALMWrapper creates a new ALM wrapper with both SNMP and REST clients
func NewALMWrapper(restCfg *config.RestAPIConfig, snmpCfg *config.SNMPConfig, device *config.AlmDeviceConfig, logger *zerolog.Logger) (*ALMWrapper, error) {
    // Create REST client
    restClient := New(restCfg, device.IPAddress, logger)

    // Create SNMP client
    snmpClient, err := snmp.NewClient(snmpCfg, device, logger)
    if err != nil {
        return nil, fmt.Errorf("failed to create SNMP client: %w", err)
    }

    return &ALMWrapper{
        restClient: restClient,
        snmpClient: snmpClient,
        logger:     logger,
        deviceID:   device.IPAddress, // Use IPAddress as deviceID since no ID field exists
        ipAddress:  device.IPAddress,
    }, nil
}

// =========================
// Types
// =========================

// OTDRParameters represents OTDR measurement parameters
type OTDRParameters struct {
    Port            int // Target port (1-16)
    PulseWidthNs    int // Pulse width in nanoseconds (e.g., 500)
    MeasurementTime int // Measurement time in seconds (e.g., 30)
    OTDRLength      int // OTDR length in meters (e.g., 20000)
    LinkLength      int // Link length in meters (e.g., 20000)
    MaxLaserPower   int // Max laser power in 0.01 dBm (-1 = device max)
}

// FingerprintParameters represents fingerprint measurement parameters
type FingerprintParameters struct {
    Port                  int // Target port (1-16)
    Mode                  int // FP mode: 2=with reflector, 6=without reflector, 8=PON (TODO verify), 12=DPA, 14=PES (TODO verify)
    RefractiveIndex       int // e.g., 1468900 => 1.468900
    ExternalOffset        int // meters (0-100)
    CouplerLossTenthDB    int // 0.1 dB units
    LinkLength            int // meters (required for mode 6)
    FPLength              int // measurement length in meters
    PulseWidthNs          int // ns
    MeasurementTime       int // seconds
    MaxLaserPowerCentidBm int // 0.01 dBm
}

// ThresholdParameters represents (existing) threshold configuration parameters
type ThresholdParameters struct {
    Port                 int // Target port (1-16)
    LossBudgetTenthDB    int // e.g., 280 = 28.0 dB
    DeviationTenthDB     int // e.g., 10 = 1.0 dB
    MonitoringEnabled    int // Performance monitoring: 2=enabled, 1=disabled
    MonitorInterval      int // seconds
    AlarmDelay           int // seconds
}

// ExtendedThresholdParameters adds the UI fields under Thresholds (P2P)
type ExtendedThresholdParameters struct {
    Port                    int
    LinkBudgetTenthDB       int // Link Budget [dB]
    LinkBudgetWarningTenthDB int // Link Budget Warning [dB]
    FastThresholdTenthDB    int // Threshold Fast [dB]
    AutoThresholdAdjust     bool // Auto Threshold Adjustment
    LinkBudgetMarginTenthDB int // Link Budget Margin [dB]
    WarningMarginTenthDB    int // Link Budget Warning Margin [dB]
}

// PortInfo represents port configuration information
type PortInfo struct {
    Port              int
    Name              string
    Remark            string
    MonitoringEnabled int // 2=enabled, 1=disabled (data collection yes/no)
}

// AlarmInfo represents ALM device alarm information
type AlarmInfo struct {
    Port        int       `json:"port"`
    AlarmID     int       `json:"alarm_id"`
    Severity    string    `json:"severity"`
    SeverityNum int       `json:"severity_num"`
    Timestamp   time.Time `json:"timestamp"`
    PortName    string    `json:"port_name"`
    PortString  string    `json:"port_string"`
    AlarmName   string    `json:"alarm_name"`
    Description string    `json:"description"`
}

