// SetPortInfo configures port name, remark, and performance monitoring
func (w *ALMWrapper) SetPortInfo(params PortInfo) error {
    w.logger.Info().Int("port", params.Port).Str("name", params.Name).Str("remark", params.Remark).Int("monitoring", params.MonitoringEnabled).Msg("Setting ALM port information")

    // Set port name
    if err := w.snmpSet(oidPortName+"."+strconv.Itoa(params.Port), gosnmp.OctetString, params.Name); err != nil {
        return fmt.Errorf("failed to set port name: %w", err)
    }
    // Set port remark
    if err := w.snmpSet(oidPortRemark+"."+strconv.Itoa(params.Port), gosnmp.OctetString, params.Remark); err != nil {
        return fmt.Errorf("failed to set port remark: %w", err)
    }
    // Set performance monitoring (Data Collection Yes/No)
    if err := w.snmpSet(oidPortPerfMon+"."+strconv.Itoa(params.Port), gosnmp.Integer, params.MonitoringEnabled); err != nil {
        return fmt.Errorf("failed to set performance monitoring: %w", err)
    }

    w.logger.Info().Int("port", params.Port).Msg("Port information set successfully")
    return nil
}

// SetPortAdminState switches Admin State (In Service / Management / Disabled)
func (w *ALMWrapper) SetPortAdminState(port, state int) error {
    w.logger.Info().Int("port", port).Int("state", state).Msg("Setting port admin state")
    if err := w.snmpSet(oidPortAdminState+"."+strconv.Itoa(port), gosnmp.Integer, state); err != nil {
        return fmt.Errorf("failed to set port admin state: %w", err)
    }
    return nil
}

// SetPortMonitoringPriority sets priority (Normal/High)
func (w *ALMWrapper) SetPortMonitoringPriority(port, priority int) error {
    w.logger.Info().Int("port", port).Int("priority", priority).Msg("Setting port monitoring priority")
    if err := w.snmpSet(oidPortPriority+"."+strconv.Itoa(port), gosnmp.Integer, priority); err != nil {
        return fmt.Errorf("failed to set monitoring priority: %w", err)
    }
    return nil
}

// GetPortStates fetches admin & oper state for a port (best-effort)
func (w *ALMWrapper) GetPortStates(port int) (admin, oper int, _ error) {
    adminPDU, err := w.snmpClient.Get(fmt.Sprintf("%s.%d", oidPortAdminState, port))
    if err != nil {
        return 0, 0, fmt.Errorf("get admin state: %w", err)
    }
    operPDU, err := w.snmpClient.Get(fmt.Sprintf("%s.%d", oidPortOperState, port))
    if err != nil {
        return 0, 0, fmt.Errorf("get oper state: %w", err)
    }
    adm, _ := adminPDU.Value.(int)
    op, _ := operPDU.Value.(int)
    return adm, op, nil
}

