// SetThresholds configures port thresholds for monitoring
func (w *ALMWrapper) SetThresholds(params ThresholdParameters) error {
    w.logger.Info().Int("port", params.Port).Int("loss_budget_tenth_db", params.LossBudgetTenthDB).Int("deviation_tenth_db", params.DeviationTenthDB).Msg("Setting ALM port thresholds")

    port := strconv.Itoa(params.Port)

    // Set loss budget threshold
    if err := w.snmpSet(oidThresholdLossBudget+"."+port, gosnmp.Integer, params.LossBudgetTenthDB); err != nil {
        return fmt.Errorf("failed to set loss budget threshold: %w", err)
    }
    // Set deviation threshold
    if err := w.snmpSet(oidThresholdDeviation+"."+port, gosnmp.Integer, params.DeviationTenthDB); err != nil {
        return fmt.Errorf("failed to set deviation threshold: %w", err)
    }
    // Enable threshold monitoring
    if err := w.snmpSet(oidThresholdEnable+"."+port, gosnmp.Integer, 1); err != nil {
        return fmt.Errorf("failed to enable threshold monitoring: %w", err)
    }
    // Monitor interval
    if err := w.snmpSet(oidMonitorInterval+"."+port, gosnmp.Integer, params.MonitorInterval); err != nil {
        return fmt.Errorf("failed to set monitor interval: %w", err)
    }
    // Alarm delay
    if err := w.snmpSet(oidAlarmDelay+"."+port, gosnmp.Integer, params.AlarmDelay); err != nil {
        return fmt.Errorf("failed to set alarm delay: %w", err)
    }
    // Monitor point thresholds
    if err := w.snmpSet(oidMonitorPointLossBudget+"."+port, gosnmp.Integer, params.LossBudgetTenthDB); err != nil {
        return fmt.Errorf("failed to set monitor point loss budget: %w", err)
    }
    if err := w.snmpSet(oidMonitorPointDeviation+"."+port, gosnmp.Integer, params.DeviationTenthDB); err != nil {
        return fmt.Errorf("failed to set monitor point deviation: %w", err)
    }

    w.logger.Info().Int("port", params.Port).Msg("Port thresholds set successfully")
    return nil
}

// SetExtendedThresholds configures extra fields from the UI (P2P tab)
// NOTE: OIDs here are placeholders to be confirmed against your device MIB.
func (w *ALMWrapper) SetExtendedThresholds(params ExtendedThresholdParameters) error {
    w.logger.Info().Int("port", params.Port).Msg("Setting extended thresholds")
    p := strconv.Itoa(params.Port)

    set := func(oid string, v int) error { return w.snmpSet(oid+"."+p, gosnmp.Integer, v) }
    if params.LinkBudgetTenthDB != 0 {
        if err := set(oidExtLinkBudget, params.LinkBudgetTenthDB); err != nil { return err }
    }
    if params.LinkBudgetWarningTenthDB != 0 {
        if err := set(oidExtLinkBudgetWarning, params.LinkBudgetWarningTenthDB); err != nil { return err }
    }
    if params.FastThresholdTenthDB != 0 {
        if err := set(oidExtFastThreshold, params.FastThresholdTenthDB); err != nil { return err }
    }
    // Auto adjust: assume 0/1
    if err := w.snmpSet(oidExtAutoAdjust+"."+p, gosnmp.Integer, boolToInt(params.AutoThresholdAdjust)); err != nil { return err }
    if params.LinkBudgetMarginTenthDB != 0 {
        if err := set(oidExtLinkBudgetMargin, params.LinkBudgetMarginTenthDB); err != nil { return err }
    }
    if params.WarningMarginTenthDB != 0 {
        if err := set(oidExtWarningMargin, params.WarningMarginTenthDB); err != nil { return err }
    }
    return nil
}

