// TriggerOTDRMeasurement triggers an OTDR measurement on specified port
func (w *ALMWrapper) TriggerOTDRMeasurement(params OTDRParameters) error {
    w.logger.Info().Int("port", params.Port).Int("pulse_width_ns", params.PulseWidthNs).Int("measurement_time", params.MeasurementTime).Int("otdr_length", params.OTDRLength).Msg("Triggering OTDR measurement")

    port := strconv.Itoa(params.Port)

    // Set OTDR parameters
    if err := w.snmpSet(oidPulseWidth+"."+port, gosnmp.Integer, params.PulseWidthNs); err != nil { return fmt.Errorf("failed to set pulse width: %w", err) }
    if err := w.snmpSet(oidMeasurementTime+"."+port, gosnmp.Integer, params.MeasurementTime); err != nil { return fmt.Errorf("failed to set measurement time: %w", err) }
    if err := w.snmpSet(oidOTDRLength+"."+port, gosnmp.Integer, params.OTDRLength); err != nil { return fmt.Errorf("failed to set OTDR length: %w", err) }
    if err := w.snmpSet(oidLinkLength+"."+port, gosnmp.Integer, params.LinkLength); err != nil { return fmt.Errorf("failed to set link length: %w", err) }
    if err := w.snmpSet(oidMaxLaserPower+"."+port, gosnmp.Integer, params.MaxLaserPower); err != nil { return fmt.Errorf("failed to set max laser power: %w", err) }

    // Trigger OTDR measurement
    if err := w.snmpSet(oidMaintainOperationRequest+"."+port, gosnmp.Integer, OperationOTDR); err != nil {
        return fmt.Errorf("failed to trigger OTDR measurement: %w", err)
    }
    w.logger.Info().Int("port", params.Port).Msg("OTDR measurement triggered successfully")
    return nil
}

// TriggerFingerprintMeasurement triggers a fingerprint measurement (generic)
func (w *ALMWrapper) TriggerFingerprintMeasurement(params FingerprintParameters) error {
    w.logger.Info().Int("port", params.Port).Int("mode", params.Mode).Int("refractive_index", params.RefractiveIndex).Int("fp_length", params.FPLength).Msg("Triggering fingerprint measurement")
    port := strconv.Itoa(params.Port)

    // Set fingerprint parameters
    if err := w.snmpSet(oidRefractiveIndex+"."+port, gosnmp.Integer, params.RefractiveIndex); err != nil { return fmt.Errorf("failed to set refractive index: %w", err) }
    if err := w.snmpSet(oidExternalOffset+"."+port, gosnmp.Integer, params.ExternalOffset); err != nil { return fmt.Errorf("failed to set external offset: %w", err) }
    if err := w.snmpSet(oidCouplerLoss+"."+port, gosnmp.Integer, params.CouplerLossTenthDB); err != nil { return fmt.Errorf("failed to set coupler loss: %w", err) }
    if err := w.snmpSet(oidFPLength+"."+port, gosnmp.Integer, params.FPLength); err != nil { return fmt.Errorf("failed to set FP length: %w", err) }
    if err := w.snmpSet(oidPulseWidth+"."+port, gosnmp.Integer, params.PulseWidthNs); err != nil { return fmt.Errorf("failed to set pulse width: %w", err) }
    if err := w.snmpSet(oidMeasurementTime+"."+port, gosnmp.Integer, params.MeasurementTime); err != nil { return fmt.Errorf("failed to set measurement time: %w", err) }
    if err := w.snmpSet(oidMaxLaserPower+"."+port, gosnmp.Integer, params.MaxLaserPowerCentidBm); err != nil { return fmt.Errorf("failed to set max laser power: %w", err) }

    // For fingerprint without reflector (mode 6), link length is required
    if params.Mode == OperationFingerprintNoRefl {
        if err := w.snmpSet(oidLinkLength+"."+port, gosnmp.Integer, params.LinkLength); err != nil {
            return fmt.Errorf("failed to set link length: %w", err)
        }
    }

    // Trigger fingerprint
    if err := w.snmpSet(oidMaintainOperationRequest+"."+port, gosnmp.Integer, params.Mode); err != nil {
        return fmt.Errorf("failed to trigger fingerprint measurement: %w", err)
    }
    w.logger.Info().Int("port", params.Port).Int("mode", params.Mode).Msg("Fingerprint measurement triggered successfully")
    return nil
}

