// CloneThresholds clones thresholds from one port to another
func (w *ALMWrapper) CloneThresholds(sourcePort, targetPort int) error {
    w.logger.Info().Int("source_port", sourcePort).Int("target_port", targetPort).Msg("Cloning port thresholds")

    // OID suffixes to clone (existing core set)
    thresholdOIDs := []string{"2", "5", "7", "8", "11", "12", "13"}

    for _, oidSuffix := range thresholdOIDs {
        sourceOID := fmt.Sprintf("1.3.6.1.4.1.2544.1.14.3.6.1.%s.%d", oidSuffix, sourcePort)
        targetOID := fmt.Sprintf("1.3.6.1.4.1.2544.1.14.3.6.1.%s.%d", oidSuffix, targetPort)

        // Get value from source port
        pdu, err := w.snmpClient.Get(sourceOID)
        if err != nil {
            w.logger.Warn().Err(err).Str("oid", sourceOID).Msg("Failed to get threshold value, skipping")
            continue
        }
        // Set value on target port
        if err := w.snmpSet(targetOID, pdu.Type, pdu.Value); err != nil {
            w.logger.Error().Err(err).Str("oid", targetOID).Msg("Failed to set cloned threshold value")
            return fmt.Errorf("failed to clone threshold OID %s: %w", oidSuffix, err)
        }
        w.logger.Debug().Str("oid_suffix", oidSuffix).Interface("value", pdu.Value).Msg("Threshold value cloned successfully")
    }

    w.logger.Info().Int("source_port", sourcePort).Int("target_port", targetPort).Msg("Port thresholds cloned successfully")
    return nil
}

