// GetActiveAlarms retrieves current active alarms from the ALM device
func (w *ALMWrapper) GetActiveAlarms() ([]AlarmInfo, error) {
    w.logger.Debug().Msg("Retrieving active alarms from ALM device")

    var alarms []AlarmInfo

    // Get alarm severities
    severities := make(map[string]int)
    err := w.snmpClient.Walk(oidAlarmSeverity, func(pdu gosnmp.SnmpPDU) error {
        // Extract origin.alarmId from OID
        oidParts := strings.Split(pdu.Name, ".")
        if len(oidParts) >= 2 {
            key := fmt.Sprintf("%s.%s", oidParts[len(oidParts)-2], oidParts[len(oidParts)-1])
            if severity, ok := pdu.Value.(int); ok {
                severities[key] = severity
            }
        }
        return nil
    })
    if err != nil {
        return nil, fmt.Errorf("failed to walk alarm severities: %w", err)
    }

    // Get alarm timestamps
    timestamps := make(map[string]time.Time)
    err = w.snmpClient.Walk(oidAlarmTimestamp, func(pdu gosnmp.SnmpPDU) error {
        // Extract origin.alarmId from OID
        oidParts := strings.Split(pdu.Name, ".")
        if len(oidParts) >= 2 {
            key := fmt.Sprintf("%s.%s", oidParts[len(oidParts)-2], oidParts[len(oidParts)-1])
            if hexStr, ok := pdu.Value.(string); ok {
                if ts, err := w.decodeDateAndTime(hexStr); err == nil {
                    timestamps[key] = ts
                }
            }
        }
        return nil
    })
    if err != nil {
        return nil, fmt.Errorf("failed to walk alarm timestamps: %w", err)
    }

    // Combine alarm data
    for key, severity := range severities {
        parts := strings.Split(key, ".")
        if len(parts) != 2 {
            continue
        }
        origin, _ := strconv.Atoi(parts[0])
        alarmID, _ := strconv.Atoi(parts[1])
        alarm := AlarmInfo{
            Port:        origin,
            AlarmID:     alarmID,
            SeverityNum: severity,
            Severity:    w.severityToString(severity),
            Timestamp:   timestamps[key],
            AlarmName:   w.alarmIDToName(alarmID),
        }
        // Get port name if available
        alarm.PortName = w.getPortName(origin)
        alarms = append(alarms, alarm)
    }

    w.logger.Info().Int("alarm_count", len(alarms)).Msg("Retrieved active alarms")
    return alarms, nil
}

