// snmpSet performs an SNMP SET operation
func (w *ALMWrapper) snmpSet(oid string, valueType gosnmp.Asn1BER, value interface{}) error {
    if w.snmpClient == nil {
        return fmt.Errorf("SNMP client not initialized")
    }
    pdu := gosnmp.SnmpPDU{Name: oid, Type: valueType, Value: value}
    _, err := w.snmpClient.Set([]gosnmp.SnmpPDU{pdu})
    if err != nil {
        return fmt.Errorf("SNMP SET %s failed: %w", oid, err)
    }
    w.logger.Debug().Str("oid", oid).Interface("value", value).Msg("SNMP SET successful")
    return nil
}

// decodeDateAndTime decodes RFC2579 DateAndTime hex string to time.Time
func (w *ALMWrapper) decodeDateAndTime(hexStr string) (time.Time, error) {
    cleanHex := strings.ReplaceAll(hexStr, " ", "")
    if len(cleanHex) < 16 {
        return time.Time{}, fmt.Errorf("invalid DateAndTime format")
    }
    year, _ := strconv.ParseInt(cleanHex[0:4], 16, 64)
    month, _ := strconv.ParseInt(cleanHex[4:6], 16, 64)
    day, _ := strconv.ParseInt(cleanHex[6:8], 16, 64)
    hour, _ := strconv.ParseInt(cleanHex[8:10], 16, 64)
    minute, _ := strconv.ParseInt(cleanHex[10:12], 16, 64)
    second, _ := strconv.ParseInt(cleanHex[12:14], 16, 64)
    return time.Date(int(year), time.Month(month), int(day), int(hour), int(minute), int(second), 0, time.UTC), nil
}

// severityToString converts numeric severity to string
func (w *ALMWrapper) severityToString(severity int) string {
    switch severity {
    case 2:
        return "CRITICAL"
    case 3:
        return "MAJOR"
    case 4:
        return "MINOR"
    case 5:
        return "INFO"
    default:
        return fmt.Sprintf("UNKNOWN(%d)", severity)
    }
}

// alarmIDToName maps alarm IDs to human-readable names
func (w *ALMWrapper) alarmIDToName(alarmID int) string {
    names := map[int]string{
        7:  "Link Not Monitored",
        10: "Fingerprint Missing",
        14: "Link Loss High",
        16: "Info/Notice",
        17: "System Info",
    }
    if name, exists := names[alarmID]; exists {
        return name
    }
    return fmt.Sprintf("Unknown Alarm %d", alarmID)
}

// getPortName retrieves port name for a given port number
func (w *ALMWrapper) getPortName(port int) string {
    oid := fmt.Sprintf("%s.%d", oidPortName, port)
    pdu, err := w.snmpClient.Get(oid)
    if err != nil {
        return ""
    }
    if name, ok := pdu.Value.(string); ok {
        return strings.Trim(name, "\"")
    }
    return ""
}

